tables.table_schema:
CREATE TABLE performance_data (
    algorithm_id INT PRIMARY KEY,
    performance_metric VARCHAR,
    timestamp TIMESTAMP,
    performance_value DECIMAL
);

CREATE TABLE algorithm_metadata (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR,
    algorithm_description TEXT,
    created_date TIMESTAMP
);

CREATE TABLE algorithm
(
    algorithm_id INT PRIMARY KEY,
    algorithm_name TEXT,
    description TEXT
);

CREATE TABLE algorithm_performance (
    algorithm_id INT NOT NULL,
    performance_date DATE NOT NULL,
    execution_time_ms INT NOT NULL,
    accuracy FLOAT NOT NULL
);

CREATE TABLE performance_history (
    performance_id SERIAL PRIMARY KEY,
    algorithm_id INT NOT NULL,
    performance_date DATE NOT NULL,
    execution_time_ms INT NOT NULL
);

CREATE TABLE prediction_data (
    prediction_id SERIAL PRIMARY KEY,
    algorithm_id INT NOT NULL,
    prediction_date DATE NOT NULL,
    predicted_value FLOAT NOT NULL
);

CREATE TABLE user_feedback (
    feedback_id SERIAL PRIMARY KEY,
    prediction_id INT NOT NULL,
    feedback_date DATE NOT NULL,
    user_feedback VARCHAR(255) NOT NULL
);
